import { Button } from "@mui/material"
import axios from "axios";

const AllProjects=()=>{
    const btn=async()  =>{

        let url= 'http://localhost:3000/api/routs/router/allProjects'
         await axios.get(url).then((item)=>{
          console.log(item);
          return item.data;
            }).catch((err)=>{
              console.log(err);
            });
      }
return (
    <Button onClick={btn}>לפרוייקטים של המדור לחץ כאן</Button>
)
}

export default AllProjects
